import React from "react";
import { Heading } from "../components/Heading";
import { AppInput } from "../components/AppInput";
import { AppCheckbox } from "../components/UI/AppCheckbox";
import { Button } from "../components/Button";
import { Controller, useForm } from "react-hook-form";

export const AcceptPage = () => {
  const { control, handleSubmit } = useForm({
    defaultValues: {
      username: "",
    },
  });

  const onAcceptSubmit = (data) => {
    console.log(data);
  };

  return (
    <div className="container">
      <div className="wrapper">
        <div className="AcceptPage">
          <Heading
            headingType="h1"
            text="АКЦЕПТ на предложение о заключении договора"
          />
          <form onSubmit={handleSubmit(onAcceptSubmit)}>
            <Controller
              name="username"
              control={control}
              render={( field ) => (
                <AppInput
                  inputLabel="Ф.И.:"
                  placeholder="Ваш ответ"
                  type="text"
                  {...field}
                />
              )}
            />
            <AppInput
              inputLabel="Номер телефона:"
              placeholder="+998 9- --- -- --"
              type="tel"
            />
            <AppCheckbox checkboxLabel="Ознакомился с публичной офертой" />
            <AppCheckbox checkboxLabel="Согласен с условиями публичной оферты" />
            <Button buttonText="Далее" buttonType="submit" />
          </form>
        </div>
      </div>
    </div>
  );
};
